В этой элитной недвижимости живут Джеки Чан, его жена и сын Джейси с 2007 года. Однако юридический спор между двумя фирмами по недвижимости привел к тому, что квартиры были конфискованы и выставлены на продажу, несмотря на апелляции Джеки Чана.
Джеки Чан подписал договор с компанией Yujia Real Estate в 2006 году о покупке двух квартир общей площадью более 1200 квадратных метров. Однако компания меняла свое название, и у нее также возникла задолженность по налогам. Все это задержало передачу прав собственности на недвижимость Джеки Чану.
Другой девелопер – Tenhong Real Estate – позже обратился в суд с иском против Yujia Real Estate для урегулирования долгов, и на эти два объекта недвижимости суд наложил арест в 2017 году.
Две квартиры будут официально выставлены на аукцион 28 сентября. Цена будет начинаться от 71,9 млн юаней, однако сейчас недвижимость оценивается более чем в 100 миллионов юаней.
